正面大きなファスナーが付いたポケットが特徴のミッキーのキッズ用リュックです。
荷物を入れるファスナーは両側に開き、柔らかく背負いやすい肩ベルトは長さを調節できます。
※縦のファスナーは飾りファスナーの為、開け閉めが多少スムーズにいきません。

